  false,\n\t\"url\": null,\n\t\"notes\": \"This plan provides a detailed overview
  of the refuge including history, management objectives, biology and ecology, and
  use. The purpose of this plan is to set forth a program of action which leads to
  the  achievement of management. targets. It will document these management targets
  and the decisions and strategies that can be accomplished in the immediate future
  with current levels of funding and staffing. However, since master planning has
  not accomplished and is not contemplated in the near future, the plan also identifies
  long-term needs and forms the basis for additional funding/staffing changes to meet
  refuge objectives.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
